const Todo = () => {
  const todosList = [
    {
      id: 1,
      content: '店予約する',
    },
    {
      id: 2,
      content: '卵買う',
    },
    {
      id: 3,
      content: '郵便出す',
    },
  ];

  return (
    <div>
      <h2>Remainder</h2>
      <TodoList />

      <input type="text" />
      <button>追加</button>
    </div>
  );
};

export default Todo;
